INSERT INTO `film` (`id`, `locandina`, `trailer`, `trama`, `data_uscita`, `titolo`, `genere`) VALUES
(2, 'https://media.posterlounge.com/img/products/710000/705266/705266_poster.jpg', 'mg0GqZmoM9M', 'Si incrociano le strade di personaggi legati al crimine. Un pugile che mente a un capo banda, due sicari che discutono massaggi ai piedi e panini, una coppia che rapina una caffetteria e altri danno vita a un dramma criminale comico quanto brutale.', '1994-10-28', 'Pulp Fiction', 'Thriller'),
(3, 'https://aforismi.meglio.it/img/film/i-mercenari.jpg', 'QHCT4m2dGqo', 'Un gruppo di professionisti delle armi e del combattimento corpo a corpo,guidati da Barney Ross, viene chiamato per porre fine alla dittatura di un sanguinario generale in un''isola del Centro America.', '2010-09-01', 'I mercenari', 'Azione'),
(5, 'https://pad.mymovies.it/filmclub/2009/06/139/locandina.jpg', 'I8nt4bAx6Z4', 'Sei amici restano intrappolati in una casa dopo una serie di avvenimenti strani e catastrofici che hanno devastato Los Angeles. Mentre fuori si assiste alla fine del mondo, in casa le poche provviste rimaste e la smania di uscire rischiano di mettere in c', '2013-06-12', 'Facciamola finita', 'Commedia'),
(6, 'https://m.media-amazon.com/images/I/51MAuTMt+gL._AC_UF894,1000_QL80_.jpg', 'hzG93_Mo-ys', 'L''impressionante ascesa e caduta di Jordan Belfort: broker di New York che tra gli anni 80 e Novanta conquista una fortuna incredibile truffando milioni di investitori. Giovane "nuovo arrivato" a Wall Street, Belfort si trasforma ben presto in un corrotto', '2014-01-23', 'The wolf of wall street ', 'Commedia'),
(7, 'https://movieplayer.net-cdn.it/t/images/2021/12/07/dont-look-up_jpg_320x0_crop_q85.jpg', 'DhYXSqz8H-o', 'Una coppia di astronomi si accorge dell''esistenza di un meteorite in rotta di collisione con la Terra. I due scienziati cercano di avvertire tutti sulla Terra che il meteorite distrugger il pianeta in sei mesi.', '2021-12-10', 'Don''t look up ', 'Commedia'),
(8, 'https://pad.mymovies.it/filmclub/2010/05/077/locandina.jpg', 'TF06_bwMBOc', 'Charlie  un adolescente timido e insicuro che cerca di superare il trauma derivante dal suicidio dell''amico Michael. Quando incontra Sam e suo fratello, il ragazzo scopre la passione per la musica e la scrittura e si innamora per la prima volta.', '2013-02-14', 'Noi siamo infinito', 'Commedia'),
(9, 'https://pad.mymovies.it/filmclub/2008/03/040/locandina.jpg', 'PRcMXEJnw3k', 'La vita di Mike O'' Donnell non ha preso la piega che lui aveva sperato, tanto che rimpiange i bei tempi delle scuole superiori. Poi un giorno, improvvisamente, il suo desiderio viene esaudito e si trova nuovamente a vivere i suoi 17 anni.', '2009-05-15', '17 Again- Ritorno al liceo', 'Commedia'),
(10, 'https://www.stardust.it/uploads/img/movie/poster/3331efc2f49fa2ac699c301e09c0c8671552604993.jpeg', '7YFMhK4i53U', 'La fama di cattivo del ladro Gru  in ribasso, soppiantata dalla presenza del giovane malfattore Vector. L''uomo decide allora di compiere un''impresa memorabile, ovvero rubare la luna.', '2010-10-15', 'Cattivissimo me', 'Animazione'),
(16, 'https://encrypted-tbn3.gstatic.com/images?q=tbn:ANd9GcTsC4i1p9Y2Tu2taLgvCJVOfSGttDt4AQaIGNv7-SuD-gqPGg-C', 'C7GzauiQflk', 'E il quinto capitolo cinematografico della celebre saga nata dalla mente della scrittrice inglese J. K. Rowling. La battaglia contro le forze oscure di Voldemort e dei suoi Mangiamorte  appena cominciata:  arrivato il momento di scendere in campo per l''Ordine della Fenice, l''organizzazione segreta fondata da Albus Silente per combattere il tentativo di Voldemort di assumere il potere nel mondo dei maghi.', '2007-07-11', 'Harry Potter e l''ordine della fenice', 'Fantasy'),
(17, 'https://m.media-amazon.com/images/I/816om2KHt0L._AC_UF894,1000_QL80_.jpg', 'u5kn6k9spJs', 'Alice ha oramai compiuto 19 anni e non ricorda pi niente delle sue avventure nel paese delle meraviglie. Ma durante una festa, che dovrebbe consentirle di fidanzarsi ufficialmente, si trova ad inseguire il Bianconiglio e a finire in un grande buco che la fa precipitare di nuovo nel mondo fatato.', '2010-03-03', 'Alice in Wonderland', 'Fantasy'),
(18, 'https://pad.mymovies.it/filmclub/2005/05/058/locandina.jpg', '2CA9C3QDkEo', 'Il proprietario di una fabbrica di dolci, Willy Wonka ha l''idea di dare vita a un concorso: le persone che nel mondo troveranno cinque tavolette di cioccolato al cui interno vi sono dei biglietti d''oro, avranno la possibilit di visitare la fabbrica, passando una giornata diversa e potendo vincere un premio.', '2005-09-23', 'La fabbrica di cioccolato', 'Fantasy'),
(19, 'https://pad.mymovies.it/filmclub/2009/10/222/immpg5.jpg', 'RaevzewXRnw', 'Parigi. L''ispettore Acheson di Scotland Yard e la sua squadra tengono d''occhio l''affascinante Elise Clifton-Ward, ex amante di Alexander Pearce, ricercato dal governo per una colossale evasione fiscale e scomparso nel nulla dopo aver cambiato chirurgicamente volto.', '2010-12-17', 'The Tourist', 'Dramma'),
(20, 'https://i.ebayimg.com/images/g/C6QAAOSw7gpjV7NH/s-l1200.webp', 'DP-AelnPZwc', 'Il film narra la tragedia del piroscafo transatlantico RMS Titanic, che ha salpato dalle sponde di Southampton il 10 Aprile 1912 con destinazione New York, una destinazione a cui non  mai giunto per una fatale collisione con un iceberg il 14 Aprile.', '1998-01-16', 'Titanic', 'Dramma'),
(21, 'https://pad.mymovies.it/filmclub/2004/08/023/locandina288.jpg', 'OXisLpgnz2o', 'Il film racconta la vita di James Barrie, scrittore dei primi del 900, e delle vicende che lo portarono a concepire il suo capolavoro: Peter Pan che and in scena per la prima volta al Teatro Duke of York di Londra nel 1904.', '2005-02-04', 'Neverland - Un sogno per la vita', 'Dramma'),
(22, 'https://www.filmtv.it/imgbank/GALLERYXL/R201306/escape_plan_poster.jpg', '-8E0H_Qtx5k', 'Ray Breslin, un esperto di sicurezza carceraria, affronta la sua pi grande sfida: fuggire dalla prigione che ha progettato. In carcere incontra una figura enigmatica, un uomo che si  guadagnato il rispetto di tutti i detenuti.', '2013-11-15', 'Escape Plan - Fuga dall''inferno', 'Azione'),
(23, 'https://mr.comingsoon.it/imgdb/locandine/big/1125.jpg', 'ANnSCQCmryE', 'Uno sfuggente maestro del crimine e la propria banda effettuano una serie di furti ad alto profilo, uno dei quali culmina in tre morti. L''uomo conosce un detective della omicidi e si sfidano, fino all''ultimo scontro finale.', '1995-07-18', 'Heat - La sfida', 'Thriller'),
(24, 'https://www.arci.it/app/uploads/2019/11/the-irishman-loca.micro_.jpg', 'SbaOCmv0X4A', 'La storia di Frank Sheeran, veterano di guerra e camionista, divenuto un sicario al soldo della malavita di Filadelfia e assoldato per uccidere il popolare sindacalista Jimmy Hoffa.', '2019-09-12', 'The Irishman', 'Thriller'),
(25, 'https://i.ebayimg.com/images/g/hHYAAOSwAodWFRYZ/s-l1600.jpg', 'd07aBOLvmuI', 'Un tassista di New York dal carattere sensibile e solitario scivola lentamente in una spirale di follia che lo spinge a ribellarsi in maniera violenta alle ingiustizie di una societ corrotta e alienante.', '1976-04-07', 'Taxi Driver', 'Thriller'),
(26, 'https://pad.mymovies.it/filmclub/2018/11/233/locandina.jpg', 'OfWMeqJtmRw', 'Rambo si  ritirato a vita privata in Arizona. Quando per riceve la notizia che una giovane a lui legata, dopo aver attraversato il confine con il Messico per andare a una festa,  stata rapita, decide di andare nella sua ricerca.', '2019-03-23', 'Rambo - Last Blood', 'Azione'),
(27, 'https://pad.mymovies.it/filmclub/2018/01/105/locandinapg2.jpg', 'CQQyW8IKscA', 'Muniti di tutte le armi a loro disposizione, i Mercenari sono l''ultima linea di difesa del mondo e la squadra che viene chiamata in causa quando tutte le altre opzioni sono esaurite.', '2023-08-09', 'I mercenari 4 - Expendables', 'Azione'),
(28, 'https://pad.mymovies.it/filmclub/2019/02/152/locandina.jpg', 'gMnFCl_Bqsk', 'Una giovane coppia americana si regala una vacanza in Svezia, in occasione di un noto festival di mezza Estate. L''evento pastorale si trasforma ben presto in un incubo sinistro quando gli abitanti del luogo rivelano la propria reale natura.', '2019-05-01', 'Midsommar - Il villaggio dei dannati', 'Horror'),
(29, 'https://www.stardust.it/uploads/img/movie/poster/40747342e543016813966e1dfc6be77d1553296905-1000w.jpg', 'w9t3zNvLmVY', 'Il giovane agente di polizia Ichabod Crane viene inviato nel nebbioso e sperduto villaggio di Sleepy Hollow per investigare su una serie di omicidi commessi dal leggendario Cavaliere senza testa.', '1999-03-30', 'Il mistero di Sleepy Hollow', 'Horror'),
(30, 'https://aforismi.meglio.it/img/film/dracula_di_bram_stoker.jpg', 'q5ma98a1_h0', 'Il conte Dracula, colpito da una maledizione che lo costringe a nutrirsi del sangue degli esseri viventi in cambio della vita eterna,  determinato a riunirsi con la propria amata. Per raggiungere i propri scopi, si reca a Londra.', '1992-10-24', 'Dracula di Bram Stoker', 'Horror'),
(31, 'https://pad.mymovies.it/filmclub/2014/07/095/locandina.jpg', 'y2c2XlkKBpo', 'Ritiratosi in campagna, l''anziano e smemorato Sherlock Holmes arranca fra i propri ricordi sempre pi annebbiati per risolvere un caso che lo ossessiona da 50 anni.', '2015-11-02', 'Mr. Holmes  Il mistero del caso irrisolto', 'Giallo'),
(32, 'https://pad.mymovies.it/filmclub/2019/04/075/locandinapg1.jpg', 'EMyStqlyQk0', 'Mentre  in vacanza sul Nilo, il geniale detective di fama mondiale Hercule Poirot si ritrova a dover indagare sull''omicidio di una giovane ereditiera.', '2022-01-21', 'Assassinio sul Nilo', 'Giallo'),
(33, 'https://musicart.xboxlive.com/7/189d5000-0000-0000-0000-000000000002/504/image.jpg?w=1920&h=1080', 'hax5cvqOdUs', 'Un lussuoso viaggio a bordo dell''Orient Express si trasforma in una corsa contro il tempo quando viene commesso un omicidio. Il detective Hercule Poirot interroga i sospettati durante una lunga sosta tra le montagne della Jugoslavia.', '2017-11-30', 'Assassinio sull''Orient Express', 'Giallo'),
(34, 'https://pad.mymovies.it/filmclub/2015/12/016/locandinapg1.jpg', 'V3x4jFKpsVI', 'Quando Frank la salsiccia viene a sapere che lui e i suoi amici sono destinati a venire mangiati, i prodotti di tutto il supermercato escogitano un piano per scappare dai propri nemici umani.', '2016-07-14', 'Sausage Party - Vita segreta di una salsiccia', 'Animazione'),
(35, 'https://pad.mymovies.it/filmclub/2011/08/107/locandina.jpg', 'Uyo5M3dYSu4', 'Riley  costretta a lasciare la propria vita nel Midwest quando il padre si trasferisce per lavoro a San Francisco. La piccola  guidata dalle proprie emozioni: Gioia, Paura, Rabbia, Disgusto e Tristezza, che vivono nel Quartier Generale, il centro di controllo nella mente, da dove l''aiutano a affrontare la vita di tutti i giorni.', '2015-09-16', 'Inside Out', 'Animazione'),
(36, 'https://pad.mymovies.it/filmclub/2007/01/025/locandina.jpg', 'k3yuPrr6c8E', 'Po  un giovane panda il cui padre gestisce un piccolo ristorante la cui specialit sono i noodles cucinati secondo una ricetta segreta. Po fa il cameriere, ma intanto sogna di poter essere un eroe del kung fu.', '2008-08-29', 'Kung Fu Panda', 'Animazione'),
(37, 'https://pad.mymovies.it/filmclub/2009/03/053/locandina.jpg', 'lk7O0ktB7Uw', 'Arrivato a Las Vegas per festeggiare l''addio al celibato del loro amico Doug, durante la notte il gruppetto si d alla pazza gioia prendendo una sbornia colossale. Al risveglio, per, qualcosa non va.', '2009-06-19', 'Una notte da Leoni', 'COMMEDIA'),
(38, 'https://cinemanuovo.it/nver/wp-content/uploads/2023/09/locandina_asteroid-city.jpg', 'rUkwjfTTgx0', 'L''itinerario di un convegno di Junior Stargazer e Space Cadet, organizzato per riunire studenti e genitori di tutto il paese per una competizione accademica e di affiatamento, viene spettacolarmente sconvolto da eventi che cambiano il mondo.', '2023-07-05', 'Asteroid City', 'COMMEDIA'),
(39, 'https://pad.mymovies.it/filmclub/2022/07/015/locandina.jpg', 'md9id0qAcxE', 'Nonostante la Seconda Guerra Mondiale, Vanda, Italo e Cosimo amano ancora giocare. Quando Riccardo, il loro amico ebreo, scompare, decidono di andare in Germania a liberarlo, seguendo a piedi i binari ferroviari.', '2023-10-12', 'L''ultima volta che siamo stati bambini', 'COMMEDIA'),
(40, 'https://pad.mymovies.it/filmclub/2009/12/056/locandina.jpg', 'HlNQpsdm2kM', 'In occasione del compleanno dei gemelli, i rapporti familiari dei Fotter rischiano di cedere sotto la pressione dei fraintendimenti e delle ingerenze dei parenti.', '2010-04-02', 'Vi presento i nostri', 'COMMEDIA'),
(41, 'https://pad.mymovies.it/filmclub/2011/05/112/locandina.jpg', 'Di9YYNT2ASI', 'Brad, che ha sempre desiderato la famiglia perfetta,  determinato a diventare il miglior patrigno del mondo per i bambini della propria nuova moglie. Quando il padre biologico si fa vivo all''improvviso, l''idilliaca vita familiare viene sconvolta.', '2015-04-09', 'Daddy''s Home', 'COMMEDIA'),
(42, 'https://pad.mymovies.it/filmclub/2008/07/070/locandina.jpg', '_i6KFW1RQpY', 'Carl Fredricksen, un venditore di pallonicini di 78 anni sta per esaudire il sogno di una vita: volare in Sud America con la propria casa. Accompagnato nel viaggio da un boyscout di 8 anni, i due affrontano mostri e furfanti di ogni tipo.', '2009-10-15', 'Up', 'Animazione'),
(43, 'https://mr.comingsoon.it/imgdb/locandine/big/62495.jpg', 'pxOshq7lkWQ', 'La giovane ninfa Mavka si innamora di un musicista umano, Lucas. Mentre i due sono sempre pi affiatati, una situazione inevitabile costringe Mavka a scegliere tra il suo amore e il suo dovere di guardiana della foresta.', '2023-02-16', 'Mavka e la foresta incantata', 'Animazione'),
(44, 'https://mr.comingsoon.it/imgdb/locandine/big/53804.jpg', 'ro2mnwYOp50', 'Miguel, un giovanissimo aspirante musicista, intraprende un viaggio verso la terra dei propri antenati per scoprire i misteri nascosti dietro i racconti e le tradizioni della famiglia.', '2017-11-22', 'Coco', 'Animazione'),
(45, 'https://pad.mymovies.it/filmclub/2021/12/084/locandinapg3.jpg', 'AByfwXr_JXs', 'Il fisico J Robert Oppenheimer lavora con una squadra di scienziati durante il Progetto Manhattan, che porta allo sviluppo della bomba atomica.', '2023-07-08', 'Oppenheimer', 'Dramma'),
(46, 'https://pad.mymovies.it/cinemanews/2019/163062/locandina-ver.jpg', 'iPOugEDF8tk', 'Ki woo viene da una famiglia povera e, tuttavia, molto unita. Quando un suo amico gli propone di sostituirlo come tutore del figlio di un ricco magnate, il ragazzo riesce a procurare un lavoro anche alla sorella usando la propria arguzia.', '2019-09-11', 'Parasite', 'Dramma'),
(47, 'https://pad.mymovies.it/filmclub/2009/05/092/locandina.jpg', 'Fb2q141rMNE', 'Cheyenne  una stella della musica rock di Dublino che vive di rendita grazie ai successi del passato. Dopo aver appreso la triste notizia della malattia incurabile del padre, l''uomo decide di far ritorno a New York per mettersi sulle tracce di un ex nazista. Quest''ultimo  responsabile di aver perseguitato l''anziano genitore in punto di morte.', '2011-10-14', 'This Must Be the Place', 'Dramma'),
(48, 'https://pad.mymovies.it/filmclub/2014/09/067/locandina.jpg', '58DHA5rbumM', 'Johann Radmann, giovane procuratore della Germania Ovest, indaga su una cospirazione messa in atto per coprire la connivenza di importanti personaggi pubblici con il regime nazista.', '2014-04-06', 'Il labirinto del silenzio', 'Dramma'),
(49, 'https://lumiere-a.akamaihd.net/v1/images/image_5ec2c019.jpeg?region=0,0,540,810', 'q4hga3UlUFU', 'Il temerario archeologo Indiana Jones lotta contro il tempo per recuperare un quadrante leggendario che pu cambiare il corso della storia. Accompagnato dalla sua figlioccia, si scontra con Jrgen Voller, un ex nazista che lavora per la Nasa', '2023-06-28', 'Indiana Jones e il quadrante del destino', 'Azione'),
(50, 'data:image/jpeg;base64,', 'cG8_b1z_-a8', 'In cerca di solitudine ed emozioni forti, Eric LeMarque si ritrova bloccato per otto giorni in una landa gelida. Lo aspetta una sfida difficile: combattere le scelte egoistiche e autodistruttive che lo hanno portato fino a quel punto.', '2017-02-08', 'L''ultima discesa', 'Thriller'),
(51, 'data:image/jpeg;base64,', 'nUdARk1n6u8', 'Travis, un disoccupato, partecipa ad un esperimento sociale in cui i partecipanti devono assumere l''identit di detenuti e guardie carcerarie. In breve tempo i prigionieri si trovano in balia dei loro custodi.', '2010-09-01', 'The Experiment', 'Thriller');
INSERT INTO `film` (`id`, `locandina`, `trailer`, `trama`, `data_uscita`, `titolo`, `genere`) VALUES
(52, 'data:image/jpeg;base64,', 'eD0dvBo8KcI', 'Un professore di Stanford realizza un controverso esperimento psicologico che mira a simulare le condizioni presenti all''interno di un penitenziario, ma ben presto la situazione sfugge gli sfugge di mano.', '2015-10-14', 'Effetto Lucifero', 'Thriller'),
(53, 'data:image/jpeg;base64,', 'W7IVMGguox0', 'Mentre Frodo e Sam, accompagnati da Gollum, proseguono il loro viaggio verso Monte Fato per distruggere l''anello, il resto della compagnia corre in soccorso di Rohan e Gondor, impegnati nella battaglia dei Campi del Pellenor.', '2003-12-12', 'Il Signore degli Anelli - Il ritorno del re', 'Fantasy'),
(54, 'data:image/jpeg;base64,', '3mXdKvAj3kU', 'Visitando il loro fastidioso cugino, Eustace, Lucy e Edmund Pevensie trovano un dipinto di una maestosa nave. Improvvisamente, il quadro prende vita e attira i giovani al suo interno, trasportandoli a Narnia, dove incontrano il loro vecchio amico, Re Caspian. Questi  in una missione per trovare i sette signori perduti di Telmar, le cui spade sono le uniche in grado di salvare il paese da una nebbia verde.', '2010-11-10', 'Le cronache di Narnia - Il viaggio del veliero', 'Fantasy');
INSERT INTO `film` (`id`, `locandina`, `trailer`, `trama`, `data_uscita`, `titolo`, `genere`) VALUES
(56, 'data:image/jpeg;base64,', 'i0in1cRXgE8', 'L''ascesa al potere di Grindelwald prosegue, ma Silente non pu attaccarlo a causa di un patto di sangue. Newt e la sua squadra cercano di opporsi al proposito del mago oscuro di trasformare il mondo magico in una platea sottoposti.', '2022-04-13', 'Animali fantastici - I segreti di Silente', 'Fantasy'),
(57, 'data:image/jpeg;base64,', 'EgxOTuBl7Bk', 'Credendo di vivere in un mondo terrificante, Beau Wasserman tiene a bada l''ansia grazie a medicinali e visite dal suo terapeuta. Tuttavia, un viaggio per visitare sua madre si trasforma in un''incredibile avventura.', '2023-04-27', 'Beau ha paura', 'Horror'),
(58, 'data:image/jpeg;base64,', 'aLAKJu9aJys', 'Un gruppo di amici scopre una tecnica tramite la quale, utilizzando una mano imbalsamata, sono in grado di evocare gli spiriti. Ai giovani non pare vero di avere scoperto un gioco cos eccitante e ne abusano finch uno di loro non esagera, aprendo definitivamente il passaggio che separa la nostra realt dal mondo degli spiriti.', '2023-09-28', 'Talk to Me', 'Horror');
INSERT INTO `film` (`id`, `locandina`, `trailer`, `trama`, `data_uscita`, `titolo`, `genere`) VALUES
(59, 'data:image/jpeg;base64,', '-iVIUWcnltE', 'L''agente speciale Dave Kujan investiga sulla causa dell''incendio di una barca nel porto di San Pedro, Los Angeles, che ha provocato la morte di 27 persone. La sua unica fonte di informazioni  Roger Kint, un criminale sopravvissuto all''incidente.', '1995-10-10', 'I soliti sospetti', 'Giallo'),
(60, 'data:image/jpeg;base64,', 'jkvsniBTliQ', 'Avechot, un paesotto disperso tra le Alpi, viene sconvolto dalla scomparsa di una adolescente. L''ispettore Vogel, chiamato ad indagare sul caso, deve confrontarsi con una realt che lascia il segno nella sua vita.', '2017-10-25', 'La ragazza nella nebbia ', 'Giallo');
